// frontend/src/components/StudentDashboard.js - UPDATED
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import Navbar from "./Navbar";
import "./StudentDashboard.css";

export default function StudentDashboard({ user, onLogout }) {
  const [exams, setExams] = useState([]);
  const [userStats, setUserStats] = useState(null);
  const [loading, setLoading] = useState(true);
  const [faceRegistered, setFaceRegistered] = useState(false);
  const [showFacePrompt, setShowFacePrompt] = useState(false);
  const navigate = useNavigate();

  useEffect(() => {
    checkFaceRegistration();
    fetchAvailableExams();
    fetchUserStats();
  }, []);

  const checkFaceRegistration = async () => {
    try {
      const token = localStorage.getItem("token");
      const response = await fetch("http://localhost:4000/api/auth/face-status", {
        headers: { Authorization: `Bearer ${token}` },
      });

      if (response.ok) {
        const data = await response.json();
        setFaceRegistered(data.isFaceRegistered);
        
        if (!data.isFaceRegistered) {
          setShowFacePrompt(true);
        }
      }
    } catch (error) {
      console.error("Error checking face registration:", error);
    }
  };

  const fetchAvailableExams = async () => {
    try {
      const token = localStorage.getItem("token");
      const response = await fetch("http://localhost:4000/api/exam/available", {
        headers: { Authorization: `Bearer ${token}` },
      });

      if (response.ok) {
        const data = await response.json();
        setExams(data.exams || []);
      }
    } catch (error) {
      console.error("Error fetching exams:", error);
    }
  };

  const fetchUserStats = async () => {
    try {
      const token = localStorage.getItem("token");
      const response = await fetch(
        `http://localhost:4000/api/exam/my-submissions/${user._id}`,
        {
          headers: { Authorization: `Bearer ${token}` },
        }
      );

      if (response.ok) {
        const data = await response.json();
        calculateStats(data.submissions || []);
      }
      setLoading(false);
    } catch (error) {
      console.error("Error fetching stats:", error);
      setLoading(false);
    }
  };

  const calculateStats = (submissions) => {
    if (submissions.length === 0) {
      setUserStats({ 
        totalExams: 0, 
        avgScore: 0, 
        bestScore: 0,
        recentScore: 0 
      });
      return;
    }

    const totalScore = submissions.reduce((sum, sub) => sum + (sub.score || 0), 0);
    const totalQuestions = submissions.reduce(
      (sum, sub) => sum + (sub.answers?.length || 0),
      0
    );
    const avgScore = totalQuestions > 0 ? ((totalScore / totalQuestions) * 100).toFixed(1) : 0;

    setUserStats({
      totalExams: submissions.length,
      avgScore,
      bestScore: Math.max(...submissions.map((s) => s.score || 0)),
      recentScore: submissions[0]?.score || 0,
    });
  };

  const handleStartExam = (examId) => {
    // STRICT CHECK: Face must be registered
    if (!faceRegistered) {
      alert(
        "üö´ ACCESS DENIED\n\n" +
        "Face Registration Required!\n\n" +
        "You MUST register your face before taking any exam.\n" +
        "This is mandatory for identity verification during the exam.\n\n" +
        "Click OK to register your face now."
      );
      navigate("/face-registration");
      return;
    }

    // Confirmation before starting
    if (window.confirm(
      `üìù Start Exam Process\n\n` +
      `You are about to begin:\n` +
      `‚Ä¢ Pre-exam verification (identity check)\n` +
      `‚Ä¢ Full exam with monitoring\n\n` +
      `‚ö†Ô∏è Important:\n` +
      `‚Ä¢ Timer starts ONLY after you pass verification\n` +
      `‚Ä¢ Your identity will be checked continuously\n` +
      `‚Ä¢ Ensure you're in a quiet, well-lit room\n` +
      `‚Ä¢ Have stable internet connection\n\n` +
      `Ready to proceed?`
    )) {
      // Navigate to pre-exam setup
      navigate(`/pre-exam/${examId}`);
    }
  };

  const handleLogout = () => {
    if (window.confirm("Are you sure you want to logout?")) {
      onLogout();
      navigate("/");
    }
  };

  if (loading) {
    return (
      <div className="dashboard-loading">
        <div className="loading-spinner"></div>
        <h3>Loading your dashboard...</h3>
      </div>
    );
  }

  return (
    <div className="student-dashboard">
      {/* Navbar */}
      <Navbar user={user} onLogout={onLogout} />
      
      {/* Face Registration Prompt */}
      {showFacePrompt && !faceRegistered && (
        <div className="face-prompt-banner">
          <div className="face-prompt-content">
            <span className="face-prompt-icon">üì∏</span>
            <div className="face-prompt-text">
              <strong>Face Verification Required</strong>
              <p>Register your face to enable identity verification during exams</p>
            </div>
            <div className="face-prompt-actions">
              <button 
                onClick={() => navigate("/face-registration")}
                className="btn-register-face"
              >
                Register Now
              </button>
              <button 
                onClick={() => setShowFacePrompt(false)}
                className="btn-dismiss"
              >
                Later
              </button>
            </div>
          </div>
        </div>
      )}

      {/* Content */}
      <div className="dashboard-content">
          {faceRegistered && (
            <span className="face-verified-badge">‚úì Face Verified</span>
          )}
        
          <div className="dashboard-actions">
            <button onClick={() => navigate("/my-results")} className="btn-secondary">
              üìä My Results
            </button>
            {!faceRegistered && (
              <button onClick={() => navigate("/face-registration")} className="btn-warning">
                üì∏ Register Face
              </button>
            )}
          </div>
      </div>

      {/* Stats Cards */}
      {userStats && (
        <div className="stats-grid">
          <div className="stat-card">
            <div className="stat-icon">üìö</div>
            <div className="stat-value">{userStats.totalExams}</div>
            <div className="stat-label">Exams Taken</div>
          </div>

          <div className="stat-card">
            <div className="stat-icon">üìà</div>
            <div className="stat-value">{userStats.avgScore}%</div>
            <div className="stat-label">Average Score</div>
          </div>

          <div className="stat-card">
            <div className="stat-icon">üèÜ</div>
            <div className="stat-value">{userStats.bestScore}</div>
            <div className="stat-label">Best Score</div>
          </div>

          <div className="stat-card">
            <div className="stat-icon">‚≠ê</div>
            <div className="stat-value">{userStats.recentScore}</div>
            <div className="stat-label">Recent Score</div>
          </div>
        </div>
      )}

      {/* Available Exams */}
      <div className="exams-section">
        <h2>üìù Available Exams</h2>

        {exams.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">üì≠</div>
            <p>No exams available at the moment</p>
            <p className="empty-subtext">Check back later for new exams</p>
          </div>
        ) : (
          <div className="exams-grid">
            {exams.map((exam) => (
              <div key={exam._id} className="exam-card">
                <div className="exam-card-header">
                  <h3>{exam.title}</h3>
                  <span className="exam-badge">Active</span>
                </div>
                
                <div className="exam-details">
                  <div className="exam-detail-item">
                    <span className="detail-icon">‚ùì</span>
                    <span>{exam.questions?.length || 0} Questions</span>
                  </div>
                  <div className="exam-detail-item">
                    <span className="detail-icon">‚è±Ô∏è</span>
                    <span>{exam.durationMins || 30} Minutes</span>
                  </div>
                  {!faceRegistered && (
                    <div className="exam-warning">
                      <span>‚ö†Ô∏è Face registration required</span>
                    </div>
                  )}
                </div>

                <button
                  onClick={() => handleStartExam(exam._id)}
                  className="btn-start-exam"
                >
                  Start Exam ‚Üí
                </button>
              </div>
            ))}
          </div>
        )}
      </div>

      {/* Suggested Resources */}
      <div className="resources-section">
        <h2>üìö Suggested Resources</h2>
        <div className="resources-grid">
          <a href="https://www.indiabix.com/aptitude/questions-and-answers/" target="_blank" rel="noopener noreferrer" className="resource-card">
            <div className="resource-icon">üìä</div>
            <div className="resource-content">
              <h3>IndiaBIX Aptitude</h3>
              <p>Practice aptitude questions and answers</p>
            </div>
          </a>
          <a href="https://www.geeksforgeeks.org/aptitude/aptitude-questions-and-answers/" target="_blank" rel="noopener noreferrer" className="resource-card">
            <div className="resource-icon">üí°</div>
            <div className="resource-content">
              <h3>GeeksforGeeks Aptitude</h3>
              <p>Comprehensive aptitude practice questions</p>
            </div>
          </a>
          <a href="https://share.google/8FL9YNILBHhEMVxss" target="_blank" rel="noopener noreferrer" className="resource-card">
            <div className="resource-icon">üé¨</div>
            <div className="resource-content">
              <h3>CareerRide YouTube</h3>
              <p>Video tutorials and career guidance</p>
            </div>
          </a>
        </div>
      </div>

      {/* Instructions */}
      <div className="instructions-section">
        <h3>‚ö†Ô∏è Exam Instructions</h3>
        <ul className="instructions-list">
          <li>‚úì Face verification will be checked before exam starts</li>
          <li>‚úì Your identity will be verified continuously during the exam</li>
          <li>‚úì Your camera will be monitored throughout the exam</li>
          <li>‚úì Keep your face visible to the camera at all times</li>
          <li>‚úì Do not switch tabs or windows - it will be tracked</li>
          <li>‚úì Multiple faces detected will be logged as suspicious activity</li>
          <li>‚úì Identity verification failures will result in automatic submission</li>
          <li>‚úì Exam will auto-submit when time expires</li>
          <li>‚úì 3 tab switches will result in automatic submission</li>
        </ul>
      </div>
    </div>
  );
}
